import React from 'react';
import Header from './Header.js';
import Main from './Main.js';
import Footer from './Footer.js';
import PopupWithForm from './PopupWithForm.js';

function App() {
  return (
    <body className="page">
      <Header />
      <Main />
      <Footer />

      <PopupWithForm name="avatar" title="Обновить аватар" buttonText="Сохранить">
        <input id="avatarlink" type="url" name="avatarlink" placeholder="Ссылка на аватар" className="popup__input popup__input_type_avatarlink" required/>
        <span className="avatarlink-error popup__form-error"></span>
      </PopupWithForm>

    </body>
  );
}

export default App;
